import React from 'react';

import Facing from './Facing';
import Card from '../UI/Card';
import './Shelf.css';

const Shelf = (props) => {
  return (
    <Card className='shelf'>
      <Facing date={props.date} />
      <div className='shelf__description'>
        <h2>{props.title}</h2>
        <div className='shelf__price'>${props.amount}</div>
      </div>
    </Card>
  );
}

export default Shelf;
